import React, { Component } from 'react';

import modal4 from '../images/modal4.png'


class Banner extends Component {

	render(){
		return(
	     	<div style={{position:'relative', display:'flex', alignItems:'center'}}>

	     		<div style={{left:'0', position:'absolute', color:'white', width:'50%', padding:'32px'}}>
	     			<h2>Mens wear</h2>
	     			<h5>Explore styles tough enough to handle all your workouts</h5>
	     			<button className='btn btn-outline-danger'>Shop Brand</button>
	     		</div>

	     		<img style={{width:'100%'}} src={modal4}/>

	     	</div>
		);
	}
}


export default Banner;
